import React from 'react'
import './signup.css'

// import person from './components/signupPage/person.png';
// import email_icon from './password.png'
// import password_icon from './email.png'


 const Signup = () => {
  return (
    <div className='container'>
      <div className='header'>
        <div className='text'>Sign Up</div>
        <div className="underline"></div>

      </div>
      <div className='input'>
        <div className='icon'>
        {/* <img src={user_icon} alt='person'/> */}
        <input type='text' placeholder='Username'/>
    </div>
    <div classname ="inputs">
      <div classname ="input">
        <img src="" alt="email"/>
        
      </div>
    </div>
    </div>
    </div>
   

  )
}
export default Signup;
